function createPDF() {
  var doc = new jsPDF('p', 'mm', 'letter');
  // letter paper w x h is 215.9mm x 279.4mm

  var totalPossibleMeals = 320;

  const url = getImage();
  // add the logo to the top of the form
  doc.addImage(url, 'PNG', 25, 5, 160, 23);

  //picture box coords
  // doc.rect(25, 5, 160, 30);

  // form will be in here
  //       L,  T,  w ,   h
  doc.rect(25, 32, 160, 37);

  doc.setFontSize(9);
  doc.setFont("times");
  doc.setFontType("bold");

  doc.text('Name of Site:', 26, 35);
  doc.text(siteName, 27, 40);

  //vertical seperator
  //      ((xPoint),(yPoint));
  doc.line(140, 32, 140, 66);

  doc.text('Date:', 141, 35);
  doc.text(shortDate.toString(), 142, 40);

  // horizontal line to hold site name and date
  doc.line(25, 42, 185, 42);

  // 2nd section - meal stuff
  doc.text('Meal: (circle one)', 26, 45);

  doc.text('Breakfast', 36, 50);
  doc.text('A.M. Snack', 53, 50);
  doc.text('Lunch', 73, 50);
  doc.text('P.M. Snack', 85, 50);
  doc.text('Supper', 105, 50);

  doc.setLineWidth(1);
  if (mealType === 'Breakfast') {
    doc.line(34, 47, 51, 51);
  } else if (mealType === 'Lunch') {
    doc.line(72, 47, 81.5, 51);
  } else if (mealType === 'Dinner') {
    doc.line(104, 48, 115, 51);
  } else if (mealType === 'Snack') {
    doc.line(53, 48, 68, 51);
  }
  doc.setLineWidth(0);

  doc.text('Site Supervisor:', 141, 45);
  doc.text(siteSupervisor, 142, 50);

  // horizontal line to hold meal choices and site supervisor
  doc.line(25, 53, 185, 53);

  doc.text('Delivery Time:', 26, 56);
  doc.text(deliveryTime.toString(), 27, 62);

  // vertical seperator
  doc.line(55.4, 53, 55.4, 66);

  doc.text('Total Meals Delivered/Prepared:', 56, 56);
  doc.text(mealsAvailable.toString(), 57, 62);

  // vertical seperator
  doc.line(102, 65, 102, 66);

  doc.text('Delivery Temperature:', 103, 56);
  doc.text(deliveryTemp, 104, 62);

  doc.text('Meal Service Time:', 141, 69);

  doc.setFontSize(12);

  doc.text('First Meals Served to Children', 19, 73);

  doc.setFontSize(9);

  //put lines through the served meals
  let leftDistance, dayCount, b = 1;
  let topDistance = 80;

  // box to hold the days
  doc.rect(17, 76, 180, 95);

  for (numRows = 0; numRows < (totalPossibleMeals / 20); numRows++) {
    leftDistance = 20;

    for (i = b; i < (b + 20); i++) {
      dayCount = i.toString();
      doc.text(leftDistance, topDistance, dayCount);

      // horizontal line under each row
      doc.line(17, topDistance + 1, 197, topDistance + 1);

      if (dayCount > 300) {
        // vertical line between each day

        doc.line(leftDistance + 6, topDistance, leftDistance + 6, topDistance + 1);

      } else if (dayCount < 20) {
        // vertical line between each day
        doc.line(leftDistance + 6, topDistance - 4, leftDistance + 6, topDistance + 6);
      } else {
        doc.line(leftDistance + 6, topDistance, leftDistance + 6, topDistance + 6);
      }

      if (i <= mealsFirst) {
        doc.setLineWidth(1);
        doc.line(leftDistance - 1, topDistance + 1, leftDistance + 4, topDistance - 3);
        doc.setLineWidth(0);
      }
      leftDistance = leftDistance + 9;
    }
    b = i;
    topDistance += 6;
  }

  doc.text('Total First Meals Served:', 141, 185);
  doc.text(mealsFirst.toString(), 180, 185);

  // second meals section

  //doc.line(10, (topDistance + 2), 200, (topDistance + 2));
  doc.text(12, (topDistance + 8), 'Complete Second Meals Served to Children:');
  doc.rect(11, (topDistance + 10), 188.4, 6);

  topDistance = topDistance + 14;
  leftDistance = 13;

  for (let j = 1; j < 28; j++) {
    dayCount = j.toString();
    doc.text(leftDistance, topDistance, dayCount);
    doc.line(leftDistance + 4.3, topDistance - 4, leftDistance + 4.3, topDistance + 2);
    doc.setLineWidth(1);
    if (j <= mealsSecond) {
      doc.line(leftDistance - 1, topDistance + 1, leftDistance + 3, topDistance - 2);
    }
    doc.setLineWidth(0);
    leftDistance = leftDistance + 7;
  }
  doc.text('Total Second Meals Served to Children: ' + mealsSecond.toString(), 123, topDistance + 7);
  // doc.text(mealsSecond.toString(), 124, (topDistance + 11));

  // NON REIMBURSABLE MEALS
  doc.setFontSize(12);
  doc.text('NON-REIMBURSABLE MEALS', 100, topDistance + 15, 'center');

  doc.setFontSize(10);
  doc.text('Meals Served to Program Adults:', 12, (topDistance + 18));

  topDistance = topDistance + 25;
  leftDistance = 13;
  doc.rect(11, (topDistance - 4), 188.4, 6);
  for (let k = 1; k < 28; k++) {
    dayCount = k.toString();
    doc.text(leftDistance, topDistance, dayCount);
    doc.line(leftDistance + 4.5, topDistance - 4, leftDistance + 4.5, topDistance + 2);
    doc.setLineWidth(1);
    if (k <= mealsProgAdult) {
      doc.line(leftDistance - 1, topDistance + 1, leftDistance + 3, topDistance - 2);
    }
    doc.setLineWidth(0);
    leftDistance = leftDistance + 7;
  }
  topDistance = topDistance - 7;
  doc.text('Total Meals Served to Program Adults: ' + mealsProgAdult.toString(), 123, (topDistance + 14));
  // doc.text(mealsProgAdult.toString(), 124, (topDistance + 20))

  doc.text('Meals Served to Non-Program Adults:', 12, (topDistance + 19));
  topDistance = topDistance + 25;
  leftDistance = 13;
  doc.rect(11, (topDistance - 4), 188.4, 6);
  for (let k = 1; k < 28; k++) {
    dayCount = k.toString();
    doc.text(leftDistance, topDistance, dayCount);
    doc.line(leftDistance + 4.5, topDistance - 4, leftDistance + 4.5, topDistance + 2);
    doc.setLineWidth(1);
    if (k <= mealsNonProgAdult) {
      doc.line(leftDistance - 1, topDistance + 1, leftDistance + 3, topDistance - 2);
    }
    doc.setLineWidth(0);
    leftDistance = leftDistance + 7;
  }
  topDistance = topDistance - 7;
  doc.text('Total Meals Served to Non-Program Adults: ' + mealsNonProgAdult.toString(), 123, (topDistance + 14));
  // doc.text(mealsNonProgAdult.toString(), 124, (topDistance + 14));

  doc.text(`Total Meals Served: ` + mealsServed.toString(), 12, 246);
  doc.text('Total Leftover Meals: ' + mealsLeftover.toString(), 55, 246);
  doc.text('Total Damaged Meals: ' + mealsDamaged.toString(), 100, 246);
  doc.text('Income From Adult Meals:', 147, 246);

  // signature box
  doc.rect(12, 249, 188.4, 14);
  doc.text(`Site Supervisor's Signature:`, 14, 252);

  // vertical seperator
  doc.line(140, 249, 140, 263);
  doc.text('Date:', 142, 252);
  doc.text(shortDate, 143, 258);

  var canvas = document.body.querySelector('canvas');

  if (canvas === null) {
    alert(
      'Site Representative must sign the form', // message
      null, // callback
      'Signature Needed', // title
      'OK' // buttonName
    );
    return false;
  } else if (canvas !== null) {
    var sig = canvas.toDataURL("image/jpeg");
    // doc.addImage(st, 'JPEG', 12, (c + 8), 80, 25);
    doc.addImage(sig, 'JPEG', 28, 255, 70, 10);
  }
  doc.save("MealCount_" + siteName + "_" + shortDate + ".pdf");
}
